import React from 'react';
import { MainRoot } from 'images';

import RootBackGround from 'Components/RootBackGround';
import Alert from 'Components/Alert';
import AddStudentComp from './AddStudentComp';

const AddStudent = ({ iconNum, handleSubmit, goBack, showPopup, onButtonTouchEnd, text }) => {
    // console.log(match.params.iconNum);
    //TODO match 해결해야 됨
    return (
        <RootBackGround
            background={MainRoot.root_background}
            title={'학습자 추가'}
            subTitle={'학습자 등록을 완료하면 검사를 시작합니다'}
            Content={() => AddStudentComp({ iconNum, handleSubmit })}
            goBack={goBack}
            text={text} onButtonTouchEnd={onButtonTouchEnd} showPopup={showPopup}
        />
    );
}

export default AddStudent;
